function ExpenseItem(props) {
  const month = props.date.toLocalString("en-US", { month: "long" });
  return (
    <div className="expens-item">
      <div>
        <div>{month}</div>
        <div>{year}</div>
        <div>{day}</div>
      </div>
      <div className="expens-item-description">
        <h2>{props.title}</h2>
        <div className="expens-item-price">${props.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
